9	1	1	Senior Frontend Engineer (Observability) - Remote Across Anz	Join the team redefining how the world experiences design.\n\nHey, g'day, mabuhay, kia ora, , hallo, vtejte!\n\nThanks for stopping by. We know job hunting can be a little time consuming and you're probably keen to find out what's on offer, so we'll get straight to the point.\n\nWhere and how you can work\n\nOur flagship campus is in Sydney. We also have a campus in Melbourne and co-working spaces in Brisbane, Perth and Adelaide. But you have choice in where and how you work, we trust our Canvanauts to choose the balance that empowers them and their team to achieve their goals.\n\nWhat youd be doing in this role\n\nAs Canva scales change continues to be part of our DNA. But we like to think that's all part of the fun. So this will give you the flavour of the type of things you'll be working on when you start, but this will likely evolve.\n\nAt the moment, this role is focused on:\n\nDelivering features, taking ownership of the entire lifecycle from design doc through to implementation and release.\nHelping deliver monitoring of critical user flows through complete end-to-end tracing.\nHelping identify gaps in Observability tooling at Canva and help take it to the next level.\nBeing proactive in modernising our Observability tooling and participating in brainstorming and POCing to determine how we can improve our existing systems.\nBeing proactive and helping improve trace instrumentation on the frontend to surface performance degradation in our frontend components.\nHelping develop solutions to tackle difficult problems such as scaling our platforms to meet Canva's customer growth.\nGuiding and mentoring other people on the team and helping them grow their skills and knowledge.\nYou're probably a match if\n\nYou have experience in TypeScript, which is a must for this role.\nYou have experience in Java or Golang which is a nice to have\nYou have deep knowledge and understanding of Computer Engineering fundamentals and first principles\nYou know Frontend performance metrics and web vitals.\nYou have experience working with and monitoring microservice architectures in large distributed cloud environments (ideally AWS).\nYou have experience with Observability tooling  having proficiency with tools like Grafana, Kibana, Sentry, or similar\nYou have experience with infrastructure-as-code, were a Terraform shop, but strong experience with other IaC tools will do the trick\nYou can guide and mentor other members of the team and improve the way we collaborate, learn, and share ideas\nThis role requires a lot of documentation and internal team members alignment; therefore strong written and verbal communication skills are required\nNot essential; but helpful experience!\n\nExperience writing native code in Kotlin or Swift since we also maintain the tracing libraries for Android and iOS. \nExperience building custom plugins for Observability data visualisation tools like Kibana, Grafana, etc\nExperience with OpenTelemetry or writing code in Golang since we are adopting OpenTelemetry in a lot of the tooling we provide.\nAbout the team\n\nThe Observability Traces & Exceptions Team is responsible for operational insights inside Canva. Our goal is to provide our development team with world-class tools to view how their services are performing in production. We achieve this by combining industry-leading third-party solutions with our own in-house developed solutions.\n\nWe work across the entire stack maintaining our tracing TypeScript & Java libraries, our tracing infrastructure, error libraries and error handling guidelines to name just a few. As we scale all of these areas, we require more sophisticated solutions to ensure that Canva developers can continue to grow without compromising on reliability or availability.\n\nWhat's in it for you?\n\nAchieving our crazy big goals motivates us to work hard - and we do - but you'll experience lots of moments of magic, connectivity and fun woven throughout life at Canva, too. We also offer a range of benefits to set you up for every success in and outside of work.\n\nHere's a taste of what's on offer:\n\nEquity packages - we want our success to be yours too\nInclusive parental leave policy that supports all parents & carers\nAn annual Vibe & Thrive allowance to support your wellbeing, social connection, office setup & more\nFlexible leave options that empower you to be a force for good, take time to recharge and supports you personally\nCheck out lifeatcanva.com for more info.\n\nOther stuff to know\n\nWe make hiring decisions based on your experience, skills and passion, as well as how you can enhance Canva and our culture. When you apply, please tell us the pronouns you use and any reasonable adjustments you may need during the interview process.\n\nWe celebrate all types of skills and backgrounds at Canva so even if you dont feel like your skills quite match whats listed above - we still want to hear from you!\n\nPlease note that interviews are conducted virtually.	Frontend	normal	IT - Software Development	220000 - 240000	Annual	Hybrid	5	Mid-Level	Sydney	NSW	Australia	2024-08-17	https://www.lifeatcanva.com/en/jobs/743999999799307/senior-frontend-engineer-observability-remote-across-anz/	{"Australian Citizen","Australian Permanent Resident"}	2024-07-18 12:29:40.513328	2024-07-18 12:29:40.513328	'achiev':114B,547B,625B 'across':6A,568B 'adelaid':88B 'adjust':782B 'adopt':499B 'align':441B 'allow':707B 'also':73B,466B,657B 'android':472B 'annual':704B 'anz':7A 'appli':771B 'architectur':362B 'area':598B 'australia':833 'avail':618B 'aw':369B 'backend':830C 'background':797B 'balanc':106B 'base':751B 'benefit':662B 'big':628B 'brainstorm':237B 'brisban':85B 'build':476B 'campus':68B,76B 'canva':126B,218B,282B,523B,607B,654B,765B,799B 'canvanaut':102B 'carer':702B 'celebr':791B 'chang':128B 'check':737B 'choic':92B 'choos':104B 'class':535B 'cloud':366B 'co':81B 'co-work':80B 'code':393B,459B,49