7	4	3	Chief Information Security Officer	The Role\n\nWe are seeking a dynamic and hands-on Chief Information Security Officer (CISO) with a strong background in application security to join our team. The ideal candidate will be passionate about leading our security strategy, with a specific focus on securing our applications and software development lifecycle. This role requires a proactive leader who thrives in a fast-paced environment and is excited about being deeply involved in both strategic planning and hands-on implementation.\n\nWhy is this an exciting role? Linktree is a massive platform with 50 million profiles, 2B monthly visitors and a massive volume of commerce activity (generating over 2% of amazons referral traffic). Despite this massive scale, we are a tiny company, 60 engineers strong, getting to move fast and drive impact. As a result, our CISO, like the rest of our executive team needs to be hands on, with the ability to drive impact themselves. We know this is a unique opportunity and we cant wait to talk to you if you are a hands-on App Sec expert with several years of experience, excited to be our CISO.\n\nWhat Youll Own\nLeadership and Strategy:\n\nDevelop and implement a comprehensive information security strategy aligned with the companys business objectives.\n\nLead the Information Security team, providing guidance, mentorship, and support to ensure the teams success.\n\nCollaborate with executive management to establish governance for the security program.\n\nApplication Security:\n\nOversee and enhance the application security program, ensuring secure software development practices are integrated throughout the SDLC.\n\nConduct regular security assessments, code reviews, and penetration testing to identify and mitigate vulnerabilities.\n\nDevelop and maintain secure coding standards, guidelines, and training for development teams.\n\nHands-On Security Operations:\n\nBe actively involved in the day-to-day security operations, including incident response, threat analysis, and vulnerability management.\n\nImplement and manage security tools and technologies to protect the organizations information assets.\n\nStay current with the latest security threats, vulnerabilities, and mitigation strategies.\n\nCompliance and Risk Management:\n\nEnsure compliance with relevant security standards and regulations (e.g., ISO 27001, GDPR, HIPAA).\n\nConduct regular risk assessments and audits, and develop action plans to address identified risks.\n\nPrepare and present regular reports on the status of information security to executive management and the board.\n\nCollaboration and Communication:\n\nFoster a culture of security awareness across the organization through training and communication.\n\nWork closely with IT, legal, HR, and other departments to ensure a coordinated approach to security and compliance.\n\nAct as the primary point of contact for all security-related matters, both internally and externally.\n\nWho Were Looking For\nEducation and Experience:\n\nMinimum of 10 years of experience in information security, with at least 5 years in a leadership role.\n\nProven experience in application security, including secure coding practices, code reviews, and vulnerability management.\n\nTechnical Skills:\n\nIn-depth knowledge of application security frameworks and best practices \n\nProficiency with security tools such as static and dynamic analysis tools, vulnerability scanners, etc\n\nHands-on experience with secure software development methodologies and DevSecOps practices.\n\nP.S. If you dont tick every box in this ad, please dont rule yourself out. We take pride in inclusion and hiring incredible human beings with great potential over ticking boxes  so if this role resonates with you, hit that apply button!\n\nWhere and How We Work\nWe are a global and diverse group offering a truly flexible and family friendly work environment. Kids, pets, and the occasional delivery person are all actively encouraged to appear on our Zoom screens. All of us at Linktree work either fully remote or a flex hybrid approach.\n\nWe offer autonomy and flexibility in how you structure your days and weeks. There will be the need for some collaboration outside of your usual 9-5 being a global company, but we aim to work asynchronously where possible.\n\nHow well help you thrive\nOur approach to benefits considers the whole person and the unique contributions they bring to Linktree. We want the experience at Linktree to be one that enables people to truly thrive so we can Go Further Together. Some ways we support you:\n\nAn annual wellbeing allowance to use on things like (but not limited to) fitness memberships, development courses, childcare, travel, charitable donations, pet insurance, home office set up - the choice is yours!\n\n100% coverage (and 80% for your dependents) of your monthly premiums for medical, dental, vision, disability and life insurance for US-based employees.\n\nEmployer contribution towards your retirement.\n\nGenerous time off for vacation, holidays, parental leave, volunteer time and other categories.\n\nEmployee Stock Option Program - we want each and every employee to share in the companys success as we go further together.\n\nTo learn more about our benefits, including our parental leave program, volunteering leave, DE&I initiatives, and more, click here!\n\nOur Story\nWe're on a mission to empower anyone to curate, grow and monetize their digital universe. We created the "link in bio" category and are trusted by some of the world's biggest brands and celebrities including TikTok, The UN Environmental Program, The White House, F1, Manchester United, Olivia Rodrigo and Selena Gomez. With over 50M+ users and 40,000 new accounts created everyday, Linktree is the fastest growing leader in our category. Linktree has partnered with some of todays biggest names like Amazon, TikTok, Snap, YouTube, GoFundMe, Spotify, Google, Stripe, Reddit and more to help unify users digital spaces  and were just getting started. Join us in empowering everyone from businesses to creatives in building their online presence.\n\nAt Linktree, we celebrate and support everyones perspective and background, and were proud to be an equal opportunity workplace. We aim to foster a diverse and inclusive environment where all team members have a sense of belonging, because we believe in going further together. Linktree welcomes all people regardless of sex, gender identity, race, ethnicity, disability, pregnancy, age, or other lived experience. If you require accommodations to fully participate in our opportunities, please don't hesitate to reach us at talent@linktr.ee  your needs are important to us.	Full-Stack	normal	Government	180000 - 200000	Annual	Office	10	Junior	Melbourne	Victoria	Australia	2024-08-16	https://linktr.ee/s/about/careers/?ashby_jid=75bed944-c288-48bf-8775-6d99146f6bde	{"Australian Citizen","Australian Permanent Resident","New Zealand Citizen","New Zealand Permanent Resident"}	2024-07-17 15:33:50.981715	2024-07-17 15:33:50.981715	'-5':640B '000':877B '10':449B '100':732B '2':112B '27001':354B '2b':100B '40':876B '5':459B '50':97B '50m':873B '60':127B '80':735B '9':639B 'abil':156B 'accommod':1006B 'account':879B 'across':397B 'act':422B 'action':365B 'activ':109B,297B,592B 'ad':528B 'address':368B 'age':998B 'aim':647B,961B 'align':212B 'allow':704B 'amazon':114B,902B 'analysi':311B,501B 'annual':702B 'anyon':825B 'app':184B 'appear':595B 'appli':560B 'applic':26B,50B,246B,252B,468B,486B 'approach':417B,613B,660B 'assess':268B,360B 'asset':328B 'asynchron':650B 'audit':362B 'australia':1032 'autonomi':616B 'awar':396B 'background':24B,949B 'base':754B 'be':544B 'believ':980B 'belong':977B 'benefit':662B,801B 'best':490B 'biggest':850B,899B 'bio':839B 'board':387B 'box':525B,550B 'brand':851B 'bring':672B 'build':935B 'busi':217B,931B 'button':561B 'candid':34B 'categori':773B,840B,890B 'celebr':853B,942B 'charit':720B 'chief':1A,16B 'child