8	4	3	Senior Backend Engineer	The Role\nWe are looking for a Staff/Senior Software Engineer to join our Security team.\n\nAs a member of the Security team, youll work across a wide range of areas to improve Linktrees security posture. This ranges from product security work, such as building easy to use and secure authentication methods to platform work to ensure teams have easy-to-use and secure development tools available. If youre excited by working with different teams and on a wide range of technologies, this role is for you.\n\nWhat Youll Own\nThe systems Linktree uses to secure our users accounts, incl. Authentication and bot mitigation systems.\n\nPartner with our platform teams in securing our development tooling, incl. CI/CD pipelines and infrastructure primitives we make available to our development teams.\n\nPartner with product and platform teams in securing our APIs and infrastructure estate.\n\nWho Were Looking For\nYou care about figuring out how to work backwards from a desired outcome and take pride in building the simplest possible solution to achieve that goal.\n\nYou care about the users of your systems and actively strive to build solutions that make their lives easier, not harder.\n\nYou get excited by, and are good at getting familiar with new technologies and existing systems written by others. \n\nExperience with our stack is a plus: Typescript, Node.js, PostGreSQL. The rest of our stack includes GraphQL, AWS (S3, EventBridge, SQS, Lambda, ECS, DynamoDB, CDK) and Snowflake. Our monolith consists of a PHP code base.\n\nSecurity experience is a plus.\n\nP.S. If you dont tick every box in this ad, please dont rule yourself out. We take pride in inclusion and hiring incredible human beings with great potential over ticking boxes  so if this role resonates with you, hit that apply button!\n\nWhere and How We Work\nWe are a global and diverse group offering a truly flexible and family friendly work environment. Kids, pets, and the occasional delivery person are all actively encouraged to appear on our Zoom screens. All of us at Linktree work either fully remote or a flex hybrid approach.\n\nWe offer autonomy and flexibility in how you structure your days and weeks. There will be the need for some collaboration outside of your usual 9-5 being a global company, but we aim to work asynchronously where possible.\n\nHow well help you thrive\nOur approach to benefits considers the whole person and the unique contributions they bring to Linktree. We want the experience at Linktree to be one that enables people to truly thrive so we can Go Further Together. Some ways we support you:\n\nAn annual wellbeing allowance to use on things like (but not limited to) fitness memberships, development courses, childcare, travel, charitable donations, pet insurance, home office set up - the choice is yours!\n\n100% coverage (and 80% for your dependents) of your monthly premiums for medical, dental, vision, disability and life insurance for US-based employees.\n\nEmployer contribution towards your retirement.\n\nGenerous time off for vacation, holidays, parental leave, volunteer time and other categories.\n\nEmployee Stock Option Program - we want each and every employee to share in the companys success as we go further together.\n\nTo learn more about our benefits, including our parental leave program, volunteering leave, DE&I initiatives, and more, click here!\n\nOur Story\nWe're on a mission to empower anyone to curate, grow and monetize their digital universe. We created the "link in bio" category and are trusted by some of the world's biggest brands and celebrities including TikTok, The UN Environmental Program, The White House, F1, Manchester United, Olivia Rodrigo and Selena Gomez. With over 50M+ users and 40,000 new accounts created everyday, Linktree is the fastest growing leader in our category. Linktree has partnered with some of todays biggest names like Amazon, TikTok, Snap, YouTube, GoFundMe, Spotify, Google, Stripe