1	1	1	Senior Frontend Engineer - Product Quality (Remote Across Anz) 	Join the team redefining how the world experiences design.\n\nHey, g'day, mabuhay, kia ora,, hallo, vtejte!\n\nThanks for stopping by. We know job hunting can be a little time consuming and you're probably keen to find out what's on offer, so we'll get straight to the point. \n\nWhere and how you can work\n\nOur flagship campus is in Sydney. We also have a campus in Melbourne and co-working spaces in Brisbane, Perth and Adelaide. But you have choice in where and how you work. That means if you want to do your thing in the office (if you're near one), at home or a bit of both, it's up to you. \n\nWhat youd be doing in this role\n\nAs Canva scales change continues to be part of our DNA. But we like to think that's all part of the fun. So this will give you the flavour of the type of things you'll be working on when you start, but this will likely evolve.\n\nAt the moment, this role is focused on:\n\nBuilding and maintaining front-end components to provide insights about the Canva product.\nCollaborate with platform teams to ensure their insights are accurately represented and displayed in our platform.\nWorking with product teams to understand and represent their features in our platform.\nInvolved in holding reviews and creating pathways to ensure teams are improving the quality of Canva overtime.\nYou're probably a match if you have:\n\nProven experience in software development, particularly in client-side applications\nExperience developing rich web applications, ideally in Typescript/React/MobX\nAbility to write performant, reusable code for UI components, including appropriate testing\nYou have an interest in developing tools and working with teams to improve the quality of the product as experienced by users\nLove to collaborate, gathering requirements across teams and specialties\nGood writing and verbal communication skills\nNice to have:\n\nBackground in data analytics and/or product measurements\nExperience building data visualisations\nExperience in full-stack development\nExperience in stakeholder communication or internal advocacy\nAbout the team\n\nThe Product Insights Enablement group is on a mission to propel Canvas growth by providing a unified platform to help teams ship confidently and measure outcomes. We are building a centralised home for all product insights so that teams act swiftly and decisively to make positive changes to the product.\n\nWe plan to tackle our mission in two steps. Step one is implementing a streamlined measurement process so that Canvanauts have the insight to decide if they should ship a change. Step two is to continuously feed insights to teams so they can make strategic decisions about what to focus on next.\n\nThe Product Quality team is working to develop new tools, frameworks, and processes to continuously report on the quality of Canvas features. These tools will surface critical platform metrics in a single, consistent location so that all teams can make well informed, quicker data-driven strategic decisions.\n\nAbout the Role\n\nWe are looking for engineers with an interest in building tools that help teams across Canva identify opportunities to improve the quality of their features. Individuals should love to collaborate. To understand the insights that other platform teams provide so we can surface them in a new user interface that you will be building. This work is critical for ensuring product teams and leaders are making informed strategic decisions about what Canva should work on next.\n\nWhat's in it for you?\n\nAchieving our crazy big goals motivates us to work hard - and we do - but you'll experience lots of moments of magic, connectivity and fun woven throughout life at Canva, too. We also offer a stack of benefits to set you up for every success in and outside of work.\n\nHere's a taste of what's on offer:\n\nEquity packages - we want our success to be yours too\nInclusive parental leave policy that supports all parents & carers\nAn annual Vibe & Thrive allowance to support your wellbeing, social connection, office setup & more\nFlexible leave options that empower you to be a force for good, take time to recharge and supports you personally\nCheck out lifeatcanva.com for more info.\n\nOther stuff to know\n\nWe make hiring decisions based on your experience, skills and passion, as well as how you can enhance Canva and our culture. When you apply, please tell us the pronouns you use and any reasonable adjustments you may need during the interview process.\n\nPlease note that interviews are conducted virtually. 	Frontend	normal	IT - Software Development	220000 - 240000	Annual	Office	5	Senior	Sydney	NSW	Australia	2024-08-07	https://www.lifeatcanva.com/en/jobs/743999997948644/senior-frontend-engineer-product-quality-remote-across-anz/	{"Australian Citizen","Australian Permanent Resident","New Zealand Citizen","New Zealand Permanent Resident"}	2024-07-08 09:26:39.582263	2024-07-08 09:26:39.582263	'abil':280B 'accur':216B 'achiev':596B 'across':7A,319B,528B 'act':399B 'adelaid':89B 'adjust':753B 'advocaci':355B 'allow':678B 'also':74B,628B 'analyt':335B 'and/or':336B 'annual':675B 'anz':8A 'appli':742B 'applic':271B,276B 'appropri':290B 'australia':771 'background':332B 'base':722B 'benefit':633B 'big':599B 'bit':121B 'brisban':86B 'build':193B,340B,388B,523B,567B 'campus':69B,77B 'canva':138B,205B,251B,370B,482B,529B,585B,625B,736B 'canvanaut':429B 'carer':673B 'centralis':390B 'chang':140B,406B,440B 'check':708B 'choic':93B 'client':269B 'client-sid':268B 'co':82B 'co-work':81B 'code':285B 'collabor':207B,316B,543B 'communic':327B,352B 'compon':199B,288B 'conduct':766B 'confid':382B 'connect':618B,684B 'consist':495B 'consum':40B 'continu':141B,445B,476B 'crazi':598B 'creat':241B 'critic':489B,571B 'cultur':739B 'd':131B 'data':334B,341B,507B 'data-driven':506B 'day':20B 'decid':434B 'decis':402B,455B,510B,582B,721B 'design':17B 'develop':265B,273B,297B,348B,469B