23	14	9	Senior Software Engineer - Fullstack	SydneyEngineering  Customer Facing Engineering /Full-time Permanent /Hybrid\nAt SafetyCulture, we help businesses get better everyday. As the operational heartbeat of working teams, our technology gives workers a voice and leaders the visibility to make smart decisions. Were constantly evolving our platform, expanding into sensors/IoT, Scalable and Event-Driven Architecture to name a few, but we believe theres more to be done.  \n\nRecently valued at AU$2.7Bn, were investing our resources into creating and shaping a better workplace for all. We are growing fast and looking for talented, self-motivated people that value collaboration, growth and learning to join our team. \n\nThe tech stack\n\nWe use a modern technology stack including Swift/Kotlin/C++ (mobile); React.js (front end); Go/node.js (back end); AWS/Kafka/Kubernetes (infrastructure) \n\nThe role\n\nYoull be empowered to manage complex architectural decisions and drive change. Youll own delivery of practical solutions to solve real-world problems for customers, with the knowledge that what you build has an immediate positive impact.\n\nYoull face exciting technical challenges as we scale, and be an integral part of the engineering team. High-performing teams here own their services, and youre trusted to build and run a system that serves hundreds of thousands of users while transforming it into a system that will serve millions of users in the near future. We empower engineers to learn new skills and use technology to solve customer problems, including initiatives in IoT, machine learning, and event-driven architecture.\n\nHow you can have an impact\n\nBe recognised as an expert in relevant technologies to the role, and have influence over the direction of the team and function. Improve others ability to deliver great work and drive initiatives focused on release-safety, repeatability, and improving the way we do things. Mentor colleagues, actively engage in building a culture of candid feedback, and help the engineering teams give and receive constructive feedback. We encourage involvement in the community, open source work, attending talks and events, and experimenting with new technologies.\n\nThe teams\n\nIn Sydney we have teams developing and supporting our SaaS platform, working on extending the functionality and longer term strategic bets, including real-time incident reporting, analytics, and IoT. Each team has a co-located manager, product manager, designer, direct access to customers, and support from specialists in quality, SRE and specific technologies. Check out some of the things weve been doing in our blog.\nEssential Skills\nDepth of knowledge in a front end and back end coding language and associated libraries/frameworks\nAbility to own delivery of complex features, break down requirements and provide reasonable estimates\nAbility to articulate effort vs impact tradeoffs\nAbility to improve others ability to deliver great work\nAbility to demonstrate SafetyCulture values (Think Customer, Open Honest Always, Better as a Team, Be Bold Bring Action)\nDesirable Skills\nExperience mentoring and teaching others\nWorking with service-oriented/microservice architectures\nExperience with key/value store and relational databases (e.g. DynamoDB, Postgres, MySQL)\nBuilding and running SaaS or cloud services at scale\nMore than a Job!\nEquity with high growth potential, and a competitive salary;\nHybrid working, we encourage you to create the best work blend while working from your home and the local SafetyCulture office;\nAccess to professional and personal training and development opportunities; \nHackathons, Workshops, Lunch & Learns;\nWe encourage involvement in the community, open source work, attending talks and events, and experimenting with new technologies.\nOffice Benefits\nIn-house Culinary Crew serving up daily breakfast, lunch and snacks;\nBarista coffee machine, craft beer on tap, boutique wines and a range of non-alcoholic beverages;\nQuarterly celebrations and team events;\nTable tennis, board games, books library, and pet-friendly office.\n\n\nWere committed to building inclusive teams and cultivating a sense of belonging so our people can bring their whole authentic selves to work each day. We seek to make reasonable adjustments throughout our recruitment process to create an even playing field for all candidates. Thanks to the tireless efforts of the entire SafetyCulture team weve built an incredible culture which has seen us recognised as a Best Place to Work in Australia, the US and the UK. \n\nEven if you don't meet every requirement listed in the ad, please consider applying for this role. We prioritise inclusion and value individuals with potential over a checklist of qualifications. Don't rule yourself out, hit that apply button if this job resonates with you You can find out more about life at SafetyCulture via Youtube, Twitter, Instagram and LinkedIn.\n\nTo all recruitment agencies, we do not accept resumes or partnership opportunities. Please do not forward resumes to SafetyCulture or any of our employees. We are not responsible for any fees associated with unsolicited resumes.\n	Full-Stack	normal	IT - Software Development	Not Listed		Hybrid	0	Senior	Sydney	NSW	Australia	2024-09-20	https://jobs.lever.co/safetyculture-2/caa9cf11-6d3c-48e4-87f2-ff56902c0879	{}	2024-08-21 00:57:59.706204	2024-08-21 00:57:59.706204	\N	\N	SafetyCulture is seeking a Senior Software Engineer - Fullstack to join their Customer Facing Engineering team in Sydney. This is a full-time, hybrid position that emphasizes collaboration, growth, and learning. The company, recently valued at AU$2.7Bn, provides a platform that supports workers and leaders, driving smart decisions in real time. Benefits include equity opportunities, professional development, hybrid working options, and a thriving office culture with in-house culinary services, events, and a pet-friendly environment.	{"Manag