141	4	3	Senior Analytics Engineer	The Role\n\nAs a Senior Analytics Engineer on the Data Platform team, you will play a critical role in building the architecture and tools that power our data analytics and reporting functions. Your expertise in data engineering and analytics will create robust data models, develop advanced analytics solutions, and deliver insights that drive business strategy. Your role will be crucial in influencing the direction of our data platform and ensuring its alignment with the companys strategic goals.\n\nWhat You'll Own\n\nCore Data Models: Design, develop, and maintain essential data models that will be leveraged across various business functions. Your work will ensure consistency and accuracy in the way data is represented and utilised throughout the company.\n\nStandards and Best Practices: Define and implement data engineering standards and best practices. Provide guidance and support to other teams to ensure adherence to these standards, promoting high-quality data processes and governance.\n\nCross-Functional Collaboration: Partner with data scientists, analysts, and engineering teams to understand their requirements and deliver data solutions that align with their needs. Facilitate effective communication and knowledge sharing across teams.\n\nStrategic Influence: Play a key role in shaping the future direction of the data platform. Provide strategic insights and recommendations to enhance the platforms capabilities and its impact on business decision-making.\n\nWho Were Looking For\n\nExperience: 2+ years of experience in analytics engineering, data engineering or a related role.\n\nTechnical Skills: Proficiency in SQL and experience with data warehousing solutions (e.g., Snowflake). Knowledge of data engineering tools and frameworks (e.g., Apache Airflow, dbt) and programming languages (e.g., Python).\n\nAnalytics Tools: Experience with business intelligence tools (e.g., Looker) and data visualisation best practices.\n\nCommunic