 goals, and strategies.\nYouve got technical depth in Artificial Intelligence, especially with conversation, dialog and large language models.\nYoure a passionate engineering leader who thrives on making impactful changes in a dynamic environment and excels as a dedicated, hands-on leader.\nYou have a desire to work in a high-visibility, highly competitive space and drive the team to success in such an environment.\nYou have first principles thinking - using a deep understanding of a problem space to make informed decisions. Even if these decisions are radically different from what others might be doing, Canva is a unique company, solving unique problems and this sometimes requires us to make bold decisions.\nYou bring a deep passion for platform engineering & empowering engineering to create business value.\nYoure a problem solver, with the ability to break large projects down into smaller ones and deliver on them through others.\n\nAbout the team\n\nSitting within the newly established Generative AI Supergroup, the Conversational Experiences Group (ConvEx) is focused on empowering the world to design by giving every person and team access to their own creative collaborator.\n\n2024 is an incredible time to join. The problem space and industry are advancing quickly and you will have direct influence on our plans to scale AI experiences for over 100 million Canva customers. \n\nWe are looking for senior engineering managers with a strong technical background in ML or have AI experience, and who thrive in fast-paced high-energy environments, to help us build the future of AI at Canva.\n\nWhat's in it for you?\n\nAchieving our crazy big goals motivates us to work hard - and we do - but you'll experience lots of moments of magic, connectivity and fun woven throughout life at Canva, too. We also offer a stack of benefits to set you up for every success in and outside of work.\n\nHere's a taste of what's on offer:\n\nEquity packages - we want our success to be yours too\