king with infrastructure as code and CI/CD\nYou have an understanding of cloud security best practice\nYou have experience utilizing service offerings such as IAM, VPC, EC2, S3, RDS and EKS within AWS would be desirable, but not required.\nYou have strong written and verbal communication skills - both technical and plain language\nAbout the team\n\nThe Cloud Tooling team's mission is to provide a secure, safe, efficient access platform for Canva engineers. Our team is responsible for designing and implementing tools, pipelines and processes that ensure access to servers and databases is audited, monitored, and compliant with the latest security standards. We take pride in ensuring that our access platform is always available to Canva engineers and that we provide excellent support to resolve any issues they encounter.\n\nIn addition to managing access platforms, the Cloud Tooling team also maintains a command line interface that serves as a critical tool for Canva's engineering teams. This CLI enables engineers to interact with different parts of Canva's infrastructure seamlessly and integrates with a range of internal systems. By ensuring the general health and availability of the CLI, the Cloud Tooling team helps to facilitate day-to-day infrastructure tasks and enables other teams to write sub-commands with ease.\n\nAs part of its ongoing mission to evolve the existing access infrastructure, the Cloud Tooling team will be focused on developing a comprehensive access platform that will enable secure, safe, and audited access to Canva's infrastructure. Ultimately, the Cloud Tooling team's work helps to support the success of Canva as a leading cloud-based design platform.\n\nWhat's in it for you?\n\nAchieving our crazy big goals motivates us to work hard - and we do - but you'll experience lots of moments of magic, connectivity and fun woven throughout life at Canva, too. We also offer a range of benefits to set you up for every success in and outside of work.\n\nH