front end); Go (back end); AWS/Kafka/Kubernetes/Citus/Postgres/Temporal (infrastructure)\n\nWhat will you do?\nYou will be rotating through all three of our Engineering departments in an 18 month programme, and get the chance to be hands-on and apply your learning. Youll get to become familiar with our tech stack, and finish with a broad range of skills and experiences.\n\nKnow anything about SAAS products? Don't worry, you bring the passion and we'll bring the training to support you along the way.\nAs our Graduate Software Engineer, you'll take ownership of critical projects right from the start. Whether it's developing features for our training platform, or fine-tuning our automated infrastructure strategies for migrating monolith to microservices,  your goal is to find the simplest and cleanest solution to the problem at hand.\nYoull experience the excitement of a fast-paced development cycle  owning a tight feedback loop, testing and shipping your code to production. You could be working on a change to a feature in the morning and see it running live in the afternoon. Our collaborative culture means youll work closely with software engineers and other departments to identify and solve problems that make a tangible impact on the business.\nWho you are\nYoure a problem solver at heart. You wont stop until youve found a solution and then you'll take one step further to improve it. In addition, youre:\nKeen to create high-performance, streamlined designs that critically impact the SafetyCulture products success and efficiency;\nCurious to learn and comfortable discussing/exploring complex technical ideas;\nHave a range of out-of-classroom projects or extra-curricular activities that demonstrates your passion for technology, particularly software engineering;\nKeen to work alongside the best engineers in the industry, with the humility to continually upskill and improve yourself;\nKnowledgeable about object-oriented design and development concepts (experience in coding is required for our technical assessment)\nEligibility\nYou will be: \nA final-year university student or recent graduate\nStudying a Computer Science, Software Engineering or related technical degree\nAn Australian or New Zealand Citizen, Australian Permanent Resident or able to provide evidence of full working rights\n\nWhat youll get\nThe chance to work alongside diverse and intelligent peers in a rewarding environment\nTraining, mentorship and personal development opportunities\nOpportunities to attend and participate in company events, expos, and connecting with customers, both locally and overseas\nEligibility: Final year university students (completing studies in 2024, graduating in 2025).\nProgram dates: February 2025\nApplication close: August 30 2024\nWhere: SafetyCulture Sydney Office	Full-Stack	normal	IT - Software Development	Not Listed		Hybrid	0	Junior	Sydney	NSW	Australia	2024-09-20	https://jobs.lever.co/safetyculture-2/ef284fee-831e-48e7-9b23-47f1a2bd8117	{A,u,s,t,r,a,l,i,a,n," ",o,r," ",N,e,w," ",Z,e,a,l,a,n,d," ",C,i,t,i,z,e,n,","," ",A,u,s,t,r,a,l,i,a,n," ",P,e,r,m,a,n,e,n,t," ",R,e,s,i,d,e,n,t," ",o,r," ",e,v,i,d,e,n,c,e," ",o,f," ",f,u,l,l," ",w,o,r,k,i,n,g," ",r,i,g,h,t,s}	2024-08-21 00:50:19.118601	2024-08-21 00:50:19.118601	\N	\N	SafetyCulture is seeking a Graduate Software Engineer for their structured 18-month program in Sydney. The role involves engaging with diverse engineering departments, working on critical projects from day one, and developing skills in a collaborative environment. Benefits include training, mentorship, and opportunities for personal development. Candidates must be studying in Australia and graduating in 2024.	{"Rotate through all three Engineering departments over 18 months","Develop features for the training platform","Optimize automated infrastructure strategies for migrating from monolith to microservices","Participate in a fast-paced development cycle","Collaborate closely with software engineers and other de