140	3	2	Analytics Engineer	Description\nOur mission and where you fit in\nAt Employment Hero, were an ambitious bunch of people on a mission to make employment easier and more valuable for everyone.\n\nSince our inception in 2014, we've had some pretty impressive growth (100% YoY), reached unicorn status in 2022, and now serve 300,000 businesses globally, with 2 million+ users on the platform. We have no plans to slow down. \n\nTheres never been a more exciting time to join one of the fastest-growing SaaS unicorns, so lets see if we could be a match!\n\nWhat your days might look like\nReporting to the Data Manager, you will be part of a highly collaborative but remotely distributed team delivering our core reusable data assets that enable a wide variety of use cases such as report building, insights generation, ML applications and customer marketing. We are focused on delivering the most valuable impacts first, while also lifting our documentation, standards and reusability to enable even more speed as we deliver.\n\nAs an Analytics Engineer, youll be:\n\nData assets development: Serve as the directly responsible individual (DRI) to translate business requirements and existing complex queries into a reusable data models / assets using dbt.\nData assets cataloguing and documentation: Develop and maintain the documentation of core and business-specific data models / assets.\nReverse ETL and customer engagement platform support: Develop and maintain data models specifically for our reverse ETL and customer engagement platform use cases.\ndbt code convention: Maintain and enforce all coding convention and standards across all dbt models, including naming.\ndbt code performance: Maintain and develop all dbt models in line with best practices to ensure optimum performance.\nIntra-team collaboration: Working with other Data Analyst(s) to translate requirements into reusable and performant data models and with Data Engineer(s) to ensure data model performance is optimised.\nAre you ready to make a significant impact in a rapidly expanding analytics team? Are you excited about taking ownership of our data assets? If you're looking for a dynamic role where you can unleash your skills and contribute to the growth of a company, then we have the perfect opportunity for you!\n\nWhat you will bring?\n\n4+ years in the Data space as an analytics engineer / data engineer.\nDemonstrated experience in ETL and data modelling projects.\nDemonstrated experience architecting flexible and scalable data warehouse and modelling practice.\nDemonstrated ability to understand and translate business requirements / metrics into technical data model development plans.\nAbility to connect the dots between technical implementation work and business context.\nBonus Points:\n\ndbt experience strongly preferred.\nExperience is important, but for us the biggest measure of success is people who can live and breathe The EH Way of working. Show us what you can bring to the table, and well empower you to let your talents shine.\n\nThe EH Way\n\nThe EH Way is how we describe our culture at Employment Hero and how we all operate. It is our DNA. You can read all about it on our careers page: \n\nIn short, youll love working with us if:\n\nRevolutionising employment gets your heart racing.\nYou thrive on the flexibility (and responsibility) of a remote-first business.\nOur values align, and shape how you show up every day.\nYou love the dynamic pace of a startup, are driven by innovation, and enjoy working with other smart people.\nPlus, youll get to enjoy a number of great perks, including: \n\nA generous budget for your home office.\nCutting-edge tools and technology.\nReward and recognition programs - because great work should be recognised and rewarded.\nCashback offers and discounts on popular brands through our Swag app.\nEmployee Share Option Program: be an owner of Employment Hero.\nAnnual Global Gathering - so far weve been to Thailand, Vietnam and are excited to meet in Bali in September 2024.\nAre we a match? \n\nThink we're the right match for you? Fantastic! Click 'Apply' and our talent team will reach out with the next steps.\n\nAt Employment Hero, we are committed to safeguarding the privacy of your application data. To understand how we do so, you can read our Applicant Privacy Policy here:	Data & ML	normal	IT - Data Analytics	80000 - 100000		Remote	4	Mid-Level	Sydney	NSW	Australia	2024-10-03	https://apply.workable.com/employment-hero/j/E3A64E5668/	{}	2024-09-03 13:24:56.562294	2024-09-03 13:24:56.562294	\N	\N	At Employment Hero, we're an ambitious company on a mission to make employment easier and more valuable for everyone. We have had impressive growth, reaching unicorn status in 2022, and serve 300,000 businesses globally with over 2 million users on our platform. As an Analytics Engineer, you will work collaboratively in a remote team, focusing on developing and maintaining reusable data assets that enable various use cases like report building and insights generation. Enjoy benefits like a generous home office budget, cutting-edge tools, recognition programs, and an Employee Share Option Program.	{"Translate business requirements and existing queries into reusable data models using dbt.","Develop and maintain documentation for core and business-specific data models.","Support reverse ETL and customer engagement platform with data models.","Enforce coding conventions and standards for dbt models.","Ensure optimum performance for all dbt models in line with best practices.","Collaborate with Data Analysts and Data Engineers to optimize data model performance."}	{"4+ years in the Data space as an analytics engineer or data engineer.","Experience in ETL and data modelling projects.","Ability to architect flexible and scalable data warehouse solutions.","Skills to translate business requirements into technical data model plans.","Understanding of the connection between technical work and business context.","Experien